import React from 'react';
import '../pages/StartVideo.css';

const StartVideopage = () => {
    return (
        <div>
            {/* logo-container */}
            <div className='logo-container'>
               <img src="/images/Ganzi1.png" alt="로고이미지"/>
            </div>

            {/* Introduce-container */}
            <div className='Introduce-container'>

            </div>

            {/* StartVideo-container */}
            <div className='StartVideo-container'>
                <div></div>
                <div className="input-container">
                    <input type="name" placeholder='+ 회의에 사용할 이름 입력'></input>
                    <input type="text" placeholder='+ 회의 링크 입력'></input>
                    <button>참여</button>
                </div>
            </div>
        </div>
    )
}

export default StartVideopage;
